import React ,{useState} from 'react';

const Logger = () => {
    const {number,setNumber}= useState(0);
    return (
        <div>
            <h1>{number}</h1>
            <button onClick={()=>setNumber(prevNumber => prevNumber +1)}>Up</button>
        </div>
    );
};

export default Logger;
